import React from 'react'
import { Navbar, Container } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

const  Naav = () => {
  return (
    <div>
       <Navbar expand='lg' className='fixed-top'>
            <Container>
                <Navbar.Brand>
                    <NavLink to='/' className='text-uppercase'>
                    BOHEM SHOP
                    </NavLink>
                    
                </Navbar.Brand>
            </Container>
       </Navbar>
    </div>
  );
}

export default Naav;
